**Command Handler Guia**
**En la terminal de tu bot ejecuta `npm install discord.js --save` luego de eso ejecuta `npm install fs --save`**
**Luego de eso crearemos una carpeta llamada `evetos` y otra llamada `comandos`**
**Despues de eso en eventos crearemos un archivo llamada `message.js` en ese archivo escribiremos lo siguiente**
```module.exports = (client, message) => { 

    if(!message.content.startsWith(client.config.prefix)) return; 
    if(message.author.bot) return;

    const args = message.content.slice(client.config.prefix.length).trim().split(/ +/g);  
    const command = args.shift().toLowerCase()

    let cmd = client.comandos.get(command) || client.aliases.get(command)
    if (!cmd) return;
    cmd.execute(client, message, args)


  }```
